import React from 'react';
import './statusCard.css';

const StatusCard = ({ id, setActiveCard, title, priority }) => {
  return (
    <div 
      id={id} 
      className="card" 
      draggable
      onDragStart={()=>setActiveCard(id)}
      onDragEnd={()=>setActiveCard(null)}
    >
      <p>{title}</p>
      <p>{priority}</p>
      <p>{id}</p>
    </div>
  );
};

export default StatusCard;
